    return(
      <BrowserRouter>
      <Route component={login} path="/" exact /> {/* Mantenha a rota de login aqui */}
      <NavBar /> {/* Adicione o NavBar fora das rotas que não precisam dele */}
      <div className="content"> {/* Crie um contêiner para o conteúdo que precisa da NavBar */}
          <Route component={CreateAdvogado} path="/createAdvogado" />
          <Route component={ListarUsuario} path="/listarUsuarios" />
          <Route component={UpdateAdvogado} path="/updateAdvogado" />
          <Route component={DeleteAdvogado} path="/deleteAdvogado" />
      </div>
  </BrowserRouter>
    )
  }


}
